     QScriptValue REcmaSolidData::destroy(QScriptContext *context, QScriptEngine *engine)
    
    {

        RSolidData* self = getSelf("RSolidData", context);
        //Q_ASSERT(self!=NULL);
        if (self==NULL) {
            return REcmaHelper::throwError("self is NULL", context);
        }
        
    
        delete self;
        context->thisObject().setData(engine->nullValue());
        context->thisObject().prototype().setData(engine->nullValue());
        context->thisObject().setPrototype(engine->nullValue());
        context->thisObject().setScriptClass(NULL);
        return engine->undefinedValue();
    }
    RSolidData* REcmaSolidData::getSelf(const QString& fName, QScriptContext* context)
    
        {
            RSolidData* self = NULL;

            
                // self could be a normal object (e.g. from an UI file) or
                // an ECMA shell object (made from an ECMA script):
                //self = getSelfShell(fName, context);
                

            //if (self==NULL) {
                self = REcmaHelper::scriptValueTo<RSolidData >(context->thisObject())
                
                ;
            //}

            if (self == NULL){
                // avoid recursion (toString is used by the backtrace):
                if (fName!="toString") {
                    REcmaHelper::throwError(QString("RSolidData.%1(): "
                        "This object is not a RSolidData").arg(fName),
                        context);
                }
                return NULL;
            }

            return self;
        }
        RSolidData* REcmaSolidData::getSelfShell(const QString& fName, QScriptContext* context)
    
        {
          RSolidData* selfBase = getSelf(fName, context);
                RSolidData* self = dynamic_cast<RSolidData*>(selfBase);
                //return REcmaHelper::scriptValueTo<RSolidData >(context->thisObject());
            if(self == NULL){
                REcmaHelper::throwError(QString("RSolidData.%1(): "
                    "This object is not a RSolidData").arg(fName),
                    context);
            }

            return self;
            


        }
        